import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="1600"
      height="1600"
      viewBox="0 0 1600 1600"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(100px)' }}
    >
      {/* More visible, soft fog */}
      <ellipse cx="0" cy="1600" rx="1100" ry="900" fill="#fff" fillOpacity="0.18" />
      <ellipse cx="0" cy="1600" rx="700" ry="600" fill="#fff" fillOpacity="0.10" />
    </svg>
  );
}
